// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Verificacio{

    //1. Elements del contracte

    // Primer identifiquem el owner del document
    address public owner;

    // Nom del document
    string public filename;
    string public hash;
    string public link;

    // validators del document
    address[] public validators;
    // No validators del document
    address[] public denegators;

    // Mapa de comprovació de les validations amb un comentari
    mapping (address=>bool) public validations;
    // Mapa de comprovació de les denegations amb un comentari
    mapping (address=>bool) public denegations;


    //2. CONSTRUCTOR
    event OwnerSet(address indexed owner, string asset);

    constructor(string memory _filename, address _owner) {
        owner = _owner;
        filename = _filename;

        emit OwnerSet(owner, filename);
    }

    //3. VALIDAR
    event Validation(address indexed validador, string asset);

    function validate() public {
        require(owner != msg.sender, "El owner no pot validar el seu asset");
        require(!validations[msg.sender], "Validador repetit");
        require(!denegations[msg.sender], "No pots validar i denegar alhora");
        validators.push(msg.sender);
        validations[msg.sender] = true;

        emit Validation(msg.sender, filename);

    }

    function validate(address validador) public {
        require(owner != validador, "El owner no pot validar el seu asset");
        require(!validations[validador], "Validador repetit");
        require(!denegations[validador], "No pots validar i denegar alhora");
        validators.push(validador);
        validations[validador] = true;

        emit Validation(validador, filename);

    }

    //4. DENEGAR
    event Denegation(address indexed denegador, string asset);

    function denegate() public {
        require(owner != msg.sender, "El owner no pot validar el seu asset");
        require(!denegations[msg.sender], "Denegador repetit");
        require(!validations[msg.sender], "No pots validar i denegar alhora");
        denegators.push(msg.sender);
        denegations[msg.sender] = true;

        emit Denegation(msg.sender, filename);

    }

    function denegate(address denegador) public {
        require(owner != denegador, "El owner no pot validar el seu asset");
        require(!denegations[denegador], "Denegador repetit");
        require(!validations[denegador], "No pots validar i denegar alhora");
        denegators.push(denegador);
        denegations[denegador] = true;

        emit Denegation(denegador, filename);

    }



    //Getters
    function hasValidated(address _user) public view returns(bool) {
        require(owner != _user);
        return validations[_user];
    }

    function hasDenied(address _user) public view returns(bool) {
        require(owner != _user);
        return denegations[_user];
    }

    function getOwner() external view returns(address){
        return owner;
    }

    function getFilename() external view returns(string memory){
        return filename;
    }

    function nValidations() public view returns(uint256) {
        return validators.length;
    }

    function nDenegations() public view returns(uint256) {
        return denegators.length;
    }

    function setHashDoc(string memory _hash) public {
        hash = _hash;
    }  

    function setLinkDoc(string memory _link) public {
        link = _link;
    }  

    


}

